import React, { Component, useState } from 'react';
import { Link } from 'react-router-dom';
import { Dropdown,Menu,Item, Toggle,DropdownButton,ItemText } from 'react-bootstrap';
class Home extends Component {
    constructor(){
        super();
        this.state = {
            text: "first set"
        };
    }
    clicked(){
       this.setState({ text: this.refs.textBox.value})
    }

    render() {

         const[newCategory, setNeweCategory]= useState(null);

        function handleChange(event) {
        setNeweCategory(event.target.value);

        }

        return (
            <div className="home-con">
                <div className="nav-bar">
                            <select  className="select"  >
                                <option value="grapefruit"> {this.state.text}</option>
                            </select>
                    <Link to="/" className="logout">LogOut</Link>
                </div>
                <div className="add-box">
                    <label>Input Category</label>
                    <br/>
                    <input onChange={handleChange} type="text"/>
                    <br/>
                    <button onClick> ADD</button>
                    <br/>
                </div>
            </div>
        );
    }
}

export default Home;
